                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">
                  Separated link
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <div className="coverpage">
        <div className="overlay">
          <h1>
            Ora Tech Systems Pvt Ltd
          </h1>
          <p>
            Ora-Tech Systems â€“ the Pioneer partner for bringing and introducing Oracle Products, Training, Implementation, Support, and Services in Global market since 1990.
          </p>
        </div>
      </div>
      </>
  );
}

export default App;
